import { React } from "react";
function handleSubmit(e) {
    e.preventDefault()
    alert('Hello World')
}
function Form(props) {
    return (
        <form>
            <h2 className="label-warapper">
                <label htmlFor="new-todo-input" className="label__lg">
                    What needs to be done?
        </label>
            </h2>
            <input
                type="text"
                id="new-todo-input"
                className="input input_lg"
                name="text"
                autoComplete="off"
            />
            <button
                type="submit"
                className="btn btn__primary btn__lg"
                onSubmit={handleSubmit}>
                Add
      </button>
        </form>
    );
}
export default Form;
